import "./form-input.scss";

const FormInput = ({ label, name, placeholder, type, value, onChangeFunction }) => {
	return (
		<div className="mb-3">
			<label htmlFor={name} className="form-label">
				{label}
			</label>
			<input type={type} className="form-control" name={name} required placeholder={placeholder} onChange={onChange} value={value} />
		</div>
	);
};

export default FormInput;
